import React from 'react';
import '../App.css';
import Slider from '@mui/material/Slider';

function value() {
    console.log('hi')
}

const AttackSlide = props => (
    <div>
        <Slider
        aria-label="Attack Level"
        defaultValue={3}
        valueLabelDisplay="auto"
        shiftStep={1}
        step={1}
        marks
        min={1}
        max={5}
        sx={{width:1000, color: '#00FF00', left: 50, height: 10}}
        />

        <button onClick={value()}></button>


    </div>
)

export default AttackSlide
